    private void Get_Data(){
         try{
String sql="select no_matricule as 'No',year as 'year',class as 'class',pourcentage1 as '%' from records_store3 order by year desc,class desc,pourcentage1 desc,no_matricule asc";
        pst=conn.prepareStatement(sql);
        rs= pst.executeQuery();
         ctable.setModel(DbUtils.resultSetToTableModel(rs));
         }catch(SQLException e){
            JOptionPane.showMessageDialog(null, e);    
           
          
     } 
     }
    
