    private void jTextField321MouseClicked(java.awt.event.MouseEvent evt) {//GEN-FIRST:event_jTextField321MouseClicked
        double percent;
        percent=Double.parseDouble(jTextField313.getText());
        if((percent<=100)&&(percent>=90)){
            jTextField321.setText("Excellent");
        }
        else if((percent<90)&&(percent>=80)){
            jTextField321.setText("Très Bon");
        }
        else if((percent<80)&&(percent>=60)){
            jTextField321.setText("Bon");
        }
        else if((percent<60)&&(percent>=50)){
            jTextField321.setText("Assez Bon");
        }
        else if((percent<50)&&(percent>=1)){
            jTextField321.setText("Mediocre");
        }
        else{
            jTextField321.setText("Unclassified");
        }
    }//GEN-LAST:event_jTextField321MouseClicked

