    private void jButton2ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jButton2ActionPerformed
        JFileChooser chooser= new JFileChooser();
        chooser.showOpenDialog(null);
        File f=chooser.getSelectedFile();
        String filename=f.getAbsolutePath();
        label_image.setIcon(new ImageIcon(f.toString()));
        filename=f.getAbsolutePath();
        path.setText(filename);
        try{
            File image=new File(filename);
            FileInputStream fis=new FileInputStream(image);
            ByteArrayOutputStream bos=new ByteArrayOutputStream();
            byte[] buf=new byte[1024];
            for(int readNum;(readNum=fis.read(buf))!=-1;){
                bos.write(buf,0,readNum);
            }
            person_image=bos.toByteArray();
        }catch(Exception e){
            JOptionPane.showMessageDialog(null,e);
        }
    }//GEN-LAST:event_jButton2ActionPerformed

    private void updatephotoActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_updatephotoActionPerformed
        try {
            String update = "update records_store3 set photo=? where no_matricule='" + matricule.getText() + "'";
            pst = conn.prepareStatement(update);
            pst.setBytes(1, person_image);
            pst.execute();
        } catch (Exception e) {
            JOptionPane.showMessageDialog(null, "photo changed");
        }
        Get_Data();
        Get_Data2();
        Get_Data3();
        Get_Data4();

    }//GEN-LAST:event_updatephotoActionPerformed

