   private Image scaleImage(byte[] img, int w, int h) {
      BufferedImage resizedImgae=new BufferedImage(w,h,BufferedImage.TYPE_INT_RGB);  
      try{
      Graphics2D g2=resizedImgae.createGraphics();
      g2.setRenderingHint(RenderingHints.KEY_INTERPOLATION,RenderingHints.VALUE_INTERPOLATION_BILINEAR);
      //convert byte array to bufferred image
      ByteArrayInputStream in=new ByteArrayInputStream(img);
      BufferedImage bImageFromConvert=ImageIO.read(in);
      g2.drawImage(bImageFromConvert,0,0,w,h,null);
      g2.dispose();         
      }catch(Exception e){
    JOptionPane.showMessageDialog(rootPane, e);
    }
      return resizedImgae;
}
